import React, { Component } from "react";
import "../css/ToDoList.css";

const ToDoList = () => {
  let items = [];
  items.push(
    <div>
      <text>item1</text>
    </div>
  );
  state = {
    count: "test"
  };
  return (
    <div className="to-do-list-container">
      <input />
      <button>submit</button>
      <div>{items}</div>
    </div>
  );
};

export default ToDoList;
